       Există mai multe criterii de clasificare a receptorilor: 
• După localizare: 
       - exteroceptori - la nivelul tegumentelor; 
       - proprioceptori - la nivelul aparatului locomotor; 
       - interoceptori - la nivelul viscerelor şi al vaselor de sânge. 
• După natura agentului excitant: 
       - excitant mecanic - mecanoreceptori;
       - excitant baric - baroreceptori;
       - excitant volumic - voloreceptori;
       - excitant termic - termoreceptori;
       - excitant dureros - algoreceptori;
       - excitant fotonic - fotoreceptori;
       - excitant chimic - chemoreceptori;
       - excitant osmotic - osmoreceptori.
• După structura receptorului:
       - terminaţii dendritice libere;
       - celule senzoriale;
       - corpusculi senzitivi;
       - organe receptoare cu structură complexă (retină, organ Corti etc.).

     Mecanismul fundamental de funcţionare a sistemului nervos este actul reflex (sau simplu, reflexul). Reflexul reprezintă reacţia de răspuns a centrilor nervoşi la stimularea unei zone receptoare. Răspunsul reflex poate fi excitator sau inhibitor. 
     Baza anatomică a actului reflex este arcul rellex, alcătuit din cinci componente anatomice: receptorul, calea aferentă, centrii nervoşi, calea eferentă şi efectorul. 
                        este o structură excitabilă care răspunde la stimuli prin variaţii de poteriţia gradate proporţional cu intensitatea agentului excitant. Majoritatea receptorilor sunt celule epiteliale diferenţiate şi specializate în celule senzoriale (gustative, auditive, vizuale, vestibulare). Alţi receptori din organism sunt corpusculi senzitivi, care sunt mici organe pluricelulare alcăruite din celule, fibre conjunctive şi terminaţii nervoase dendritice (receptorii tegumentari, proprioceptorii). Uneori, rolul de receptori îl îndeplinesc chiar terminaţiile butonate ale dendritelor (receptorul olfactiv, receptorii dureroşi). La nivelul receptorului are loc transformarea energiei excitantului în influx nervos. În funcţie de tipul excitantului, se deosebesc cinci tipuri principale de receptori, şi anume: 
• mecanoreceptori, care detectează deformările mecanice ale receptorului sau ale celulelor vecine acestuia (receptorii tactili); 
• termoreceptori, care sesizează schimbările de temperatură, unii receptori fiind specializaţi pentru senzaţia de cald şi alţii pentru senzaţia de rece; 
• nociceptori (sau receptori ai durerii), care detectează injurii tisulare, indiferent dacă acestea sunt de natură fizică sau chimică; 
• receptori electromagnetici, care detectează lumina la nivelul retinei; 
• chemoreceptori, care detectează gustul (situaţi în cavitatea bucală), mirosul (situaţi în cavitatea nazală), nivelul oxigenului în sângele arterial, osmolaritatea lichidelor din organism, concentraţia dioxidului de carbon şi, probabil, a altor substanţe importante în biochimia organismului.
